  type,
  alt,
  checked,
  maxlength,
  placeholder,
  value,
  min,
  max,
  name,
}) {
  const { handleChange, handleSearchChange} = useContext(Context);

  if(!search) (
    <input
      type={type}
      alt={alt}
      check={checked}
      maxLength={maxlength}
      placeholder={placeholder}
      value={value}
      min={min}
      max={max}
      name={name}
      onChange={handleChange}
      required
    />
  )
  ;
}
